import jwt from "jsonwebtoken";

const getTokenData = (token) => {
  let decoded = null;
  let data = null;
  try {
    decoded = jwt.decode(token);
  } catch (error) {
    console.error(error);
  }
  data = decoded;
  console.log(data);
  return data;
};

export default getTokenData;
